// A.sol
pragma solidity ^0.8.7;

import "./B.sol";

contract A {
    B private b;

    constructor() {
        b = new B(); // 创建B合约的实例
    }

    function getSomething() public view returns (uint) {
        return b.doSomething(); // 调用B合约的方法
    }
}

